import React, {Component} from 'react';
import CountryCard from './CountryCard';

const Countries = ({country}) => {
		return ( 
			<div>
			 { country.map((each, i) => {
			 	console.log(i, each);
			 	return (<CountryCard key={i} name={each[i].name.common} capital={each[i].capital[0]} continent={each[i].continents[0]} subregion={each[i].subregion} map={each[i].maps.googleMaps} unMember={each[i].unMember} population={each[i].population} flag={each[i].flags.png} />)
			 })
			}
				{console.log(country)}
			</div>
		)
}

export default Countries;
